import React,{ useRef, useState } from "react";
import axios from 'axios';



const Registration = () => {
  
    const [name,setName]=useState("");
    const [email,setEmail]=useState("");
    const [password,setPassword]=useState("");
    const [number,setNumber]=useState("");
    
    
    
    const ref1 = useRef();
    
    const PostData=()=>{
      // data.preventDefault();
      axios.post('http://localhost:4000/regRoute/register',{name,email,password,number}).then((res)=>{console.log(res.data);
          ref1.current.innerText=res.data.msg;
        }
      ).catch(err=>(err.message));
    } 
  return (
    <>
      <section>
        <div>    
        <label htmlFor=""> Name: </label>
        <input type="text" value={name} onChange={(e)=>setName(e.target.value)}/> <br /> <br />
        <label htmlFor=""> Email: </label>
         <input type="email" value={email} onChange={(e)=>setEmail(e.target.value)}/> <br /> <br />
         <label htmlFor="">Password: </label>
         <input type="password" value={password} onChange={(e)=>setPassword(e.target.value)}/> <br /> <br />
         <label htmlFor="">  Phone No.: </label>
         <input type="text" value={number} onChange={(e)=>setNumber(e.target.value)}/> <br /> <br />
            <button onClick={PostData}>Data Post</button>    
        </div>
        <div>

        </div>
      </section>
    </>
  )
}

export default Registration
